INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2015/12/17 15:00:00", 7, 106001, 0.0, -363.0, 0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0, "2030/12/17 14:59:59", "キャル", 1, 7001);
