INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2015/12/17 15:00:00", 10, 105801, 0.0, -363.0, 0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0, "2030/12/17 14:59:59", "ペコリーヌ", 1, 10001);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2015/12/17 15:00:00", 10, 106001, 0.0, -363.0, 0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0, "2030/12/17 14:59:59", "キャル", 1, 10002);
