INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2015/12/17 15:00:00", 13, 105901, 0.0, -363.0, 0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0, "2030/12/17 14:59:59", "コッコロ", 1, 13002);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 2104010, 2, "2015/12/17 15:00:00", 13, 106401, 0.0, -363.0, 0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0, "2030/12/17 14:59:59", "シェフィ", 1, 13003);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2015/12/17 15:00:00", 13, 105801, 0.0, -363.0, 0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0, "2030/12/17 14:59:59", "ペコリーヌ", 1, 13004);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2015/12/17 15:00:00", 14, 105901, 0.0, -363.0, 0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0, "2030/12/17 14:59:59", "コッコロ", 1, 14001);
