INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2015/12/17 15:00:00", 14, 105801, 0.0, -363.0, 0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0, "2030/12/17 14:59:59", "ペコリーヌ", 1, 14003);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2015/12/17 15:00:00", 14, 106001, 0.0, -363.0, 0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0, "2030/12/17 14:59:59", "キャル", 1, 14004);
