INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 2104010, 2, "2015/12/17 15:00:00", 16, 106401, 0.0, -363.0, 0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0, "2030/12/17 14:59:59", "シェフィ", 1, 16001);
