INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (2, 0, 1, "2019/01/31 12:00:00", 24, 109001, 8.0, -385.0, 10.11, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 3, 24003);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (2, 0, 1, "2019/01/31 12:00:00", 24, 109001, 8.0, -385.0, 4.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 4, 24004);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (2, 0, 1, "2019/01/31 12:00:00", 24, 109001, 8.0, -385.0, 6.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 5, 24005);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2019/01/31 12:00:00", 24, 109002, 0.0, 0.0, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 6, 24006);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2019/01/31 12:00:00", 24, 109002, 0.0, 0.0, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 7, 24007);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2019/01/31 12:00:00", 24, 109002, 0.0, 0.0, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 8, 24008);
