INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (1, 0, 1, "2019/01/31 12:00:00", 24, 109002, 0.0, 0.0, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10, 24010);
